var calcDays = function(y , m ,d){    
   var isLeep = (( (y%4==0) && ( y%100!=0) ) || (y%400==0 ) );    
   var days   = d;
   for( var i = 1 ; i< m ; i++ ) {
      if( i == 2 ) {
        if ( isLeep )
           days += 29;
        else days+=28;
      }
      else if ( m==4 || m==6 || m==9 || m==11 )
        days += 30;
      else days+=31;
   }
   return days;
}

var startDay = calcDays( nong.y, 1, 1 ),
    nowDay   = calcDays( nong.y, nong.m, nong.d ),
    endDay   = calcDays( nong.y, 12, 31 ),
    year     = nowDay / endDay,
    month    = function() {
      if ( [ 1, 3, 5, 7, 8, 10, 12 ].includes( nong.m ) ) {
          return nong.d / 30;
      } else if ( nong.m == 2 ) {
          return nong.d / 28;
      } else return nong.d / 30;
    },
    week     = nong.w == 0 ? 7 : nong.w / 7,
    day      = new Date().getHours() / 24;

